using namespace std; 
 
class SumAndProduct 
{ 
public: 
  int smallestSet(int S, int P) 
  { 
    if (S == P) 
      return 1; 
 
    for (int i = 2; i <= S; i++) 
    { 
      double d = i; 
      if ((S / d) >= pow(P, 1.0 / d)) 
      { 
        cout << S / d << endl; 
        return i; 
      } 
    } 
 
    return - 1; 
  } 
};

